import React from 'react';
import '../styles/Header.css';

function Header() {
  return (
    <div id="header">
      <div className="header-left"> {/* 왼쪽에 배치할 div */}
        <h2>⚖️BALANCETALK</h2>
      </div>
      <div className="header-right"> {/* 오른쪽에 배치할 div */}
        <button id="new">+NEW</button>
        <button className="login-buttons">Login</button>
        <button className="login-buttons">Register</button>
      </div>
    </div>
  )
}

export default Header;
